import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from 'react';
import axios from 'axios';
import '../assets/css/buscador.css'
import { Jumbotron } from 'react-bootstrap';



function Upload() {

  const [archivos, setArchivos]=useState(null);

  const subirArchivos=e=>{
      setArchivos(e);
  }
  const insertarArchivos=async()=>{
      const f = new FormData();

      for (let index = 0; index < archivos.length; index++) {
          f.append("files", archivos[index]);
      }

      await axios.post("", f)
      .then(response =>{
        console.log(response.data);

      }).catch(error=>{
          console.log(error);
      })
  }


  return (

    <Jumbotron className=" jum-style">
    <h1 className="texto-buscador">Subir Archivo</h1>
    <form >
        <div className="row" >
            <div className="form-group col-md-8">
                <input  type="file" name="files" multiple onChange={(e)=>subirArchivos(e.target.files)} className="form-control form-control-lg busqueda-place">
                </input>
            </div>
            <div className="form-group col-md-4">
                <button className="btn btn-lg boton-pur btn-block" value="Buscar"> Subir
                </button>

            </div>
        </div>
    </form>
    

</Jumbotron>
    
  );
}


export default Upload;
